import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

function App(){
    return(
        <>
            <h1 className="heading"> Here Are Some Product List </h1>
            {Sdata.map((val) => {
                {val.imgsrc}
                {val.title}
                {val.price}
            })}
        </>
    )
}

export default App;
